"""En esta grfica podemos observar una ligera tendencia descendiente (a largo plazo) de los tiempos de vuelta. Sin embargo, los saltos abruptos en la tendencia evidencias cambios tecnolgicos y regulatorios disruptivos, con capacidad de influenciar (positivamente o negativamente) de forma significativa al desempeo de los monoplazas.

Particularmente, destaca el incremento de tiempos a partir de 2020, que podra ser resultado de las regulaciones recientes para balancear el poder de las escuderas y el desarollo de los monoplazas.

Consideraciones futuras:

- Cambios en el trazado de los circuitos
- Variables Medioambientales (lluvia, viento, temperatura, etc.)

**Tiempos de Vuelta por Constructores**

Por otro lado, la Formula 1 **NO se trata de un deporte balanceado**, en particular, a causa de la desigualdad entre escuderas. 

Las diferencias de capital y capacidad tcnica entre escuderas produce cada ao una gran desigualdad en la calidad de los vehculos de los corredores. Por esa razn, nos parece releevante analizar tamben el desempeo histrico de cada escudera. De nuevo, utilizaremos de mtrica el tiempo de vuelta.

En este contexto, aplicaremos dos tipos de mtricas:

*   **Consistencia:** emplearemos el tiempo **medio** de vuelta como mtrica.
*   **Rapidez** emplearemos el tiempo **mnimo** de vuelta como mtrica
"""

# Mtrica 1 - Consistencia
df_constructors_consistence = df_analisis_tiempos.groupby(['year', 'constructor_name'], as_index= False)['milliseconds'].mean()
df_constructors_consistence.head(5)

